  const pageNumbersCount = posts.length / config.maxPostsQuantity;
  return (
    <div className="bg-[#5A5C66] w-1/2 my-4 px-7 py-5 flex items-center justify-between">
      <input placeholder="Поиск" className="bg-inherit w-11/12 text-white" />
      <SearchIcon />
    </div>
  );
}
